																															<div class="xs-force-center textable">
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Больше магии</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">Увеличенное время работы в режиме телефонного разговора. Активация Siri с помощью голоса. Всё это AirPods — уникальные беспроводные наушники. Они подойдут ко всем вашим устройствам. Достаньте их из футляра, и сразу можете пользоваться. Просто наденьте их, и они мгновенно установят соединение, а значит, вы сможете сразу погрузиться в насыщенный качественный звук. Словно по волшебству.</p>
																																<p style="text-align: center;"><br></p>
																																<p style="text-align: center;"><img alt="" src="https://i.citrus.ua/uploads/content/product-photos/lysyanaya/march/aa1.jpg?_t=1553095795" class="fr-dii fr-draggable"></p>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Ноль проводов. Максимум преимуществ</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">AirPods настраиваются в одно касание. Автоматически включаются и устанавливают соединение. Пользоваться ими невероятно легко. Они оснащены специальными сенсорами, поэтому когда вы снимаете наушники, воспроизведение останавливается. При этом AirPods великолепно взаимодействуют как с iPhone, так и с Apple Watch, iPad и Mac.</p>
																																<p style="text-align: center;"><br></p>
																																<p style="text-align: center;"><img alt="" src="https://i.citrus.ua/uploads/content/product-photos/lysyanaya/march/aa2.jpg?_t=1553095794" class="fr-dii fr-draggable"></p>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Попросите Siri</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">Поговорить с вашим голосовым помощником стало ещё проще. Даже не нужно брать iPhone в руки. Просто скажите: «Привет, Siri».</p>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Возможности звучат мощно</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">Новый чип H1, созданный Apple, обеспечивает более стабильное беспроводное соединение с вашими устройствами и более быструю передачу данных: до 2 раз быстрее при переключении между активными устройствами и в 1,5 раза быстрее при телефонных звонках. Благодаря чипу H1 теперь Siri можно активировать с помощью голоса, а ещё задержка сигнала при использовании наушников во время компьютерных игр стала до 30% ниже. Поэтому, чем бы вы ни занимались — играли в игры, слушали музыку или подкасты, — качество звучания всегда будет потрясающим.</p>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Знают, когда вы слушаете</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">Акселерометр и оптические сенсоры, взаимодействуя друг с другом, управляют различными аудио‑функциями: активируют микрофоны для телефонных звонков и голосовых команд Siri, а также позволяют AirPods воспроизводить звук, когда наушники уже в ушах. При этом вы можете использовать и оба наушника, и только один. А ещё AirPods распознают двойные касания, с помощью которых удобно включать и выключать музыку или переключать треки.</p>
																																<p style="text-align: center;"><br></p>
																																<p style="text-align: center;"><img alt="" src="https://i.citrus.ua/uploads/content/product-photos/lysyanaya/march/aa3.jpg?_t=1553097281" class="fr-dii fr-draggable"></p>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Знают, когда вы говорите</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">Специальный акселерометр умеет распознавать, что вы разговариваете. Благодаря этому он помогает направленным микрофонам отфильтровать внешний шум и фокусироваться на звуке вашего голоса.</p>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Целые сутки звучания</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">AirPods позволяют слушать музыку 5 часов без подзарядки — это лучший показатель в индустрии. Время работы в режиме телефонного разговора теперь составляет до 3 часов. Кроме того, футляр обеспечивает наушникам несколько циклов зарядки, благодаря чему они могут работать более 24 часов. Нужна быстрая подзарядка? Уберите наушники AirPods обратно в футляр на 15 минут, и потом вы сможете ещё 3 часа слушать музыку или 2 часа разговаривать по телефону. А если нужно проверить заряд аккумулятора, просто поднесите AirPods к iPhone или спросите у Siri: «Сколько заряда в моих AirPods?».</p>
																																<p style="text-align: center;"><br></p>
																																<p style="text-align: center;"><img alt="" src="https://i.citrus.ua/uploads/content/product-photos/lysyanaya/march/aa4.jpg?_t=1553095794" class="fr-dii fr-draggable"></p>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Легко настроить. Просто заслушаться</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">Наушники AirPods мгновенно устанавливают соединение с iPhone и Apple Watch. Поэтому, когда вы переключаетесь с одного устройства на другое, смена источника звука происходит моментально. Хотите послушать музыку с Mac или iPad? Достаточно выбрать AirPods на этих устройствах. Простая настройка — волшебный результат.</p>
