																														<div class="">
																															<div class="xs-force-center textable">
																																<h2 style="text-align: center;"><span style="font-size: 22px;"><strong>Airpods Pro: максимум возможностей, максимум удовольствия</strong></span></h2>
																																<p><br></p>
																																<p style="text-align: center;">Новые наушники Airpods Pro от Apple впечатляют с первого взгляда и с первой ноты. Это не просто функциональный девайс. Это маленькое произведение искусства, меняющее восприятие повседневности. Разработчики создали совершенно особое устройство, призванное погрузить пользователя в мир музыки. В нем объединились инновационные технологии, внимание к деталям, особая эстетика бренда - все, чтобы прочувствовать волшебство звука.</p>
																																<p style="text-align: center;"><br></p>
																																<p style="text-align: center;"><img alt="" src="https://i.citrus.ua/uploads/content/product-photos/lysyanaya/october%202019/ap1.jpg?_t=1572356313" class="fr-dii fr-draggable"></p>
																																<h2 style="text-align: center;"><br></h2>
																																<h2 style="text-align: center;"><br></h2>
																																<h2 style="text-align: center;"><span style="font-size: 22px;"><strong>Особенности новой линейки Apple Airpods Pro:</strong></span></h2>
																																<p><span style="font-size: 22px;"><strong><br></strong></span></p>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Четкое звучание</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">Встроенный адаптивный эквалайзер Adaptive EQ отвечает за четкость и глубину на средних и низких частотах. Его главное достоинство в том, что изменение звука основывается на строении ушной раковины пользователя и расположении &nbsp;гаджета внутри нее. Эффективный усилитель, который нивелирует посторонние шумы, балансирует громкость и экономит заряд аккумулятора.</p>
																																<p style="text-align: center;"><br></p>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Только музыка и ничего лишнего</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">Функция активного шумоподавления. Работает в реальном времени, регулируя звучание 200 раз в секунду. Все это - благодаря 10-ядерному микропроцессору H1 с двумя микрофонами. Внешний улавливает звуки, затем они компенсируются обратной волной. Внутренний микрофон анализирует звучание внутри уха и подавляет остатки шума. Это обеспечивает минимальную задержку и полную изоляцию.</p>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Защищенные от влаги</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">Защита от попадания влаги по стандарту IPX4 позволяет заниматься спортом или гулять под дождем под аккомпанемент любимых исполнителей.</p>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Комфортная посадка </strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">Apple Airpods Pro представляют собой внутриканальные Bluetooth-наушники на основе технологии System in Package design - схема из нескольких элементов объединяется в одном корпусе. При этом расположение данных элементов основано на анатомии уха, обеспечивая максимальную эргономичность. В комплекте предлагаются три варианта вкладышей из силикона, которые повторяют внутреннюю форму уха.</p>
																																<p style="text-align: center;"><br></p>
																																<p style="text-align: center;"><img alt="" src="https://i.citrus.ua/uploads/content/product-photos/lysyanaya/october%202019/ap2.jpg?_t=1572356313" class="fr-dii fr-draggable"></p>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Удобное управление</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">На ножке располагаются специальные датчики давления. Посредством этих датчиков можно управлять воспроизведением, а также опцией прозрачности. Единоразовое нажатие помогает начать или прекратить воспроизведение, ответить на входящий вызов. Двойное - переключит на следующую композицию. Тройное - вернет на предыдущую. А нажатие с удерживанием - переключит с шумоподавления на «прозрачность» и наоборот.</p>
																																<p style="text-align: center;"><br></p>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Попросите Siri</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">Используйте личного помощника Siri с голосовым управлением для контроля аудио, звонков, регулировки громкости, прослушивания сообщений или навигации.</p>
																																<p style="text-align: center;"><br></p>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Целый день в запасе</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">Каждый наушник оснащен отдельным аккумулятором, дающим им до 4,5 часов непрерывного воспроизведения с шумоподавлением или в прозрачном режиме или 5 часов при обычном использовании. Это время увеличивается до 24 часов благодаря зарядному кейсу. Он не только заряжает наушники каждый раз, как только вы убираете их в футляр, но и надежно защищает их во время переноски.</p>
																																<p style="text-align: center;"><br></p>
																																<p style="text-align: center;"><img alt="" src="https://i.citrus.ua/uploads/content/product-photos/lysyanaya/october%202019/ap3.jpg?_t=1572356313" class="fr-dii fr-draggable"></p>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Беспроводная зарядка</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">Слушайте и заряжайте без проводов. Bluetooth-наушники Airpods Pro поставляются в комплекте с компактным функциональным кейсом, который поддерживает функцию беспроводной зарядки. Просто положите его на платформу любого совместимого устройства стандарта Qi и зарядка начнется автоматически. Или можете использовать Lightning-порт в основании чехла. Его размеры - 60,6х45,2х21,7 мм при массе 45,6 г. В комплект также входят набор силиконовых вкладок трех видов, шнур Lightning к USB-C.</p>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Делитесь музыкой</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">Система Audio Sharing - для совместного прослушивания музыки или подкастов двумя наборами Эйрподс.</p>
																																<h3 style="text-align: center;"><br></h3>
																																<h3 style="text-align: center;"><span style="font-size: 22px;"><strong>Узнаваемый стиль</strong></span></h3>
																																<p><br></p>
																																<p style="text-align: center;">В этой модели дизайнеры марки смогли сохранить фирменный стиль, при этом привнеся в него актуальное футуристичное настроение. Плавные линии, глянцевое белое покрытие, минималистичность - все поддерживает последние тенденции дизайна.</p>
