																												<p align="left">- повреждения, вызванные дефектами системы, в которой использовался данный товар, или возникшие в результате соединения и подключения товара к другим изделиям;</p>
																												<p align="left">- повреждения, вызванные использованием товара не по назначению или с нарушением правил эксплуатации.</p>
																												<p align="left">Согласно Закону Украины «О защите прав потребителей» Покупатель имеет право на обмен или возврат купленного товара. Воспользоваться данным правом Покупатель может в течении первых 14 дней с момента покупки(не считая дня покупки).</p>
