																					<div plp-spoiler-toggle="" il-action="toggle" class="spoiler2-header is-collapsed">
																						<div class="textable">
																							<p style="text-align: center;"><span style="font-size: 16px;"><span style="color: rgb(17, 17, 17);"><strong>Договорные гарантийные обязательства интернет-магазина <strong>"AirPods Store™"</strong></strong></span></span></p>
																						</div>
																						<div class="spoiler2-toggle">
																							<i class="fa fa-chevron-down"></i>
																						</div>
																					</div>
																					<div plp-spoiler-container="" class="spoiler2-container is-collapsed" style="display: none;">
																						<div class="cont">
																							<div class="node node726 widget widget-text">
																								<div class="wrapper1">
																									<div class="wrapper2">
																										<div class="">
																											<div class="textable">
																												<p>1. Продавец гарантирует, что купленное изделие является работоспособным и не содержит выявленных механических и иных повреждений на момент осуществления продажи. Комплектность изделий проверяется при покупке.</p>
																												<p align="left">2. Гарантия на проданные изделия, при условии соблюдения условий гарантии, подразумевает под собой бесплатный ремонт изделий в течение гарантийного срока, указанного в гарантийном талоне, либо их замену на аналогичные по назначению в случае невозможности ремонта.</p>
																												<p align="left">3. Гарантия действительна только при наличии Гарантийного талона, подписанного Покупателем.</p>
																												<p align="left">4. Покупатель обязан до начала ввода в эксплуатацию оборудования ознакомиться с данными правилами гарантийного обслуживания, и убедиться в отсутствии внешних повреждений.</p>
																												<p align="left">5. Продавец не обеспечивает гарантийное обслуживание поставленных изделий в случаях:</p>
																												<p align="left">- утери гарантийного талона, наличия в нём записей или исправлений, сделанных не Продавцом(кроме полей подлежащих заполнению Покупателем);</p>
																												<p align="left">- наличия механических повреждений (помятости, сколы, глубокие царапины, трещины, следы удара, изгиб или перелом товара, и т.п.), а также со стёртой маркировкой изделий, неразборчивой маркировкой;</p>
																												<p align="left">- наличия признаков ремонта неуполномоченными лицами (вскрытия блоков, следов пайки, следов механических повреждений на винтах, нарушения гарантийных пломб, замены деталей и т.п.);</p>
																												<p align="left">- наличия повреждений, полученных в результате аварий, воздействия огня, влаги, агрессивных химических веществ, а также в результате действий третьих лиц или непреодолимой силы;</p>
																												<p align="left">- с признаками горения или дымления изделия (прогар токопроводящих элементов, микросхем, платы, корпуса, др.);</p>
																												<p align="left">- наличия повреждений, вызванных попаданием внутрь изделия посторонних предметов, насекомых и т.п.;</p>
																												<p align="left">- неисправности, возникшей в следствие использования неоригинальных расходных материалов;</p>
																												<p align="left">- выхода изделия из строя по вине Покупателя (при использовании изделия не по назначению, коммерческой эксплуатации изделия бытового назначения, неправильной установке и подключении, эксплуатации не по назначению, хранении в небезопасном месте и небрежной транспортировке);</p>
																												<p align="left">- работы изделия с нелицензионными, несертифицированными или зараженными компьютерным вирусом программными продуктами;</p>
																												<p align="left">- несоответствия Государственным стандартам параметров электропитающих, телекоммуникационных и кабельных сетей и другими внешними факторами (климатическими и иными);</p>
																												<p align="left">- некорректной работы с программно - аппаратной частью изделия (перепрограммирование и т.п.);</p>
																												<p align="left">- а также в иных случаях, предусмотренных действующим законодательством Украины.</p>
																												<p align="left">В случае необходимости Продавец вправе перед началом ремонта отправить оборудование на экспертизу сроком до 14 рабочих дней, без учёта времени транспортировки, для получения заключения о причинах возникновения неисправности.</p>
																												<p align="left">Замена изделия производится только в том случае, если оно не может быть отремонтировано, на основании заключения экспертизы. Срок гарантийного ремонта, в зависимости от его сложности, может составлять 14 рабочих дней, без учёта времени транспортировки.</p>
																												<p align="left">Гарантийные обязательства не распространяются на следующие неисправности:</p>
																												<p align="left">- естественный износ или исчерпание ресурса;</p>
																												<p align="left">- случайные повреждения (дефекты, причиненные клиентом);</p>
																												<p align="left">- повреждения в результате стихийных бедствий (природных явлений);</p>
																												<p align="left">- повреждения, возникшие вследствие небрежного отношения или использования (несоблюдение температурного режима, воздействие жидкости, запыленности, механическое повреждение, попадание внутрь корпуса посторонних предметов);</p>
																												<p align="left">- повреждения, вызванные аварийным повышением или понижением в сети;</p>
																												<p align="left">- повреждения, вызванные неправильным подключением к электросети;</p>
																												<p align="left">- повреждения, вызванные дефектами системы, в которой использовался данный товар, или возникшие в результате соединения и подключения товара к другим изделиям;</p>
																												<p align="left">- повреждения, вызванные использованием товара не по назначению или с нарушением правил эксплуатации.</p>
																												<p align="left">Согласно Закону Украины «О защите прав потребителей» Покупатель имеет право на обмен или возврат купленного товара. Воспользоваться данным правом Покупатель может в течении первых 14 дней с момента покупки(не считая дня покупки).</p>
