																												<p><span style="color: rgb(17, 17, 17);">Согласно Закону Украины «О защите прав потребителей» покупатели интернет-магазина имеют право на обмен или возврат купленных товаров. Воспользоваться данным правом покупатель может в течении первых 14 дней с момента покупки (не считая дня покупки) при соблюдении ряда требований к товару:<br><br>Сохранены и не повреждены: полная комплектация, ярлыки, целостность и все компоненты упаковки, заводская маркировка, пломбы и защитные пленки<br>Товар должен быть новый, то есть который не был в эксплуатации и не имеет визуальных следов использования (царапин, потертостей);<br>Устройство не проходило активацию, его программное обеспечение не изменялось.<br>Для оформления обмена или возврата нового товара покупателю необходимо заранее сообщить о своем желании обменять/вернуть товар менеджеру, после чего следовать инструкциям.</span></p>
