																								<p style="text-align: center;"><span style="color: rgb(17, 17, 17);"><span style="font-family: &quot;TTNorms Bold&quot;;"><span style="font-size: 28px;">Політика конфіденційності</span></span></span><span style="font-size: 22px;"><strong><br></strong></span></p>
