																									<div class="wrapper1">
																										<div class="wrapper2">
																											<div class="">
																												<div class="xs-force-center textable">
																													<h2 style="text-align: center;"><span style="color: rgb(17, 17, 17);"><span style="font-size: 12px;">Дата внесення останніх правок до оферти: 21.02.2017</span></span></h2>
																													<h2 style="text-align: center;"><span style="color: rgb(17, 17, 17);"><br></span></h2>
																													<h2 style="text-align: center;"><span style="color: rgb(17, 17, 17);"><strong>Захист особистих даних</strong></span></h2>
																													<p><span style="color: rgb(17, 17, 17);"><br></span></p>
																													<p><span style="color: rgb(17, 17, 17);">Для захисту особистих даних клієнта у нас запроваджено ряд засобів, які діють при введенні, передачі або роботі з Вашими особистими даними.</span></p>
																													<h2 style="text-align: center;"><span style="color: rgb(17, 17, 17);"><br></span></h2>
																													<h2 style="text-align: center;"><span style="color: rgb(17, 17, 17);"><strong>Розголошення особистих відомостей і передача цих відомостей третім особам</strong></span></h2>
																													<h2><span style="color: rgb(17, 17, 17);"><br></span></h2>
																													<h2><span style="color: rgb(17, 17, 17);">Ваша особиста інформація може бути розголошена нами тільки в тому випадку якщо це необхідно для:</span></h2>
																													<h2><span style="color: rgb(17, 17, 17);">(а) забезпечення відповідності розпорядженням закону або вимогам судового процесу в нашому відношенні;</span></h2>
																													<h2><span style="color: rgb(17, 17, 17);">(б) захиститу наших прав або власності;</span></h2>
																													<h2><span style="color: rgb(17, 17, 17);">(в) вжиття термінових заходів щодо забезпечення особистої безпеки наших співробітників або споживачів наших послуг, а також забезпечення громадської безпеки.</span></h2>
																													<p><span style="color: rgb(17, 17, 17);">Особисті відомості, отримані в наше розпорядження при замовленні товару, можуть передаватися третім організаціям та особам, які перебувають з нами в партнерських відносинах лише для поліпшення якості послуг, що надаються. Ці відомості не будуть використовуватися в будь-яких інших цілях, крім перерахованих вище. Адреса електронної пошти, наданої Вами при реєстрації може використовуватися для відправки Вам повідомлень або повідомлень про зміни, пов'язані з Вашою заявкою, а також розсилки повідомлень про події та зміни в компанії, важливої інформації про нові товари і послуги тощо. Передбачена можливість відмови від підписки на ці поштові повідомлення.</span></p>
																													<p><span style="color: rgb(17, 17, 17);"><br></span></p>
																													<h2 style="text-align: center;"><span style="color: rgb(17, 17, 17);"><strong>Використання файлів «cookie»</strong></span></h2>
																													<p><span style="color: rgb(17, 17, 17);"><br></span></p>
																													<h2><span style="color: rgb(17, 17, 17);">Коли користувач відвідує веб-вузол, на його комп'ютер записується файл «cookie» (якщо користувач дозволяє прийом таких файлів у налаштуваннях веб-браузера). Якщо ж користувач уже відвідував даний веб-вузол, файл «cookie» зчитується з комп'ютера. Один із напрямків використання файлів «cookie» пов'язаний із тим, що з їх допомогою полегшується збір статистики відвідування. Ці відомості допомагають визначати, яка інформація, що відправляється клієнтам, може представляти для них найбільший інтерес. Збір цих даних здійснюється в узагальненому вигляді і ніколи не співвідноситься з особистими відомостями користувачів.</span></h2>
																													<p><span style="color: rgb(17, 17, 17);">Треті сторони, включаючи компанії Google, Яндекс, ВКонтакте, показують оголошення нашої компанії на сторінках сайтів в Інтернеті. Треті сторони, включно з організацією Google, Яндекс, ВКонтакте, використовують cookie, щоб показувати оголошення, засновані на попередніх відвідуваннях користувачем наших веб-сайтів і інтересах в веб-браузерах. Користувачі можуть заборонити компаніям Google, Яндекс, ВКонтакте використовувати cookie. Для цього необхідно відвідати спеціалізовані сторінки компаній та перейти до розділу приватності.</span></p>
																													<h2 style="text-align: center;"><span style="color: rgb(17, 17, 17);"><br></span></h2>
																													<h2 style="text-align: center;"><span style="color: rgb(17, 17, 17);"><strong>Зміни в оферті про дотримання конфіденційності</strong></span></h2>
																													<h2><span style="color: rgb(17, 17, 17);"><strong><br></strong>Оферту про дотримання конфіденційності передбачається оновлювати за потребою внесення правок. При цьому буде змінюватися дата попереднього поновлення, зазначена на початку документа. Повідомлення про зміни в даній оферті будуть розміщуватися на видному місці наших веб-вузлів.</span></h2>
																													<p><span style="color: rgb(17, 17, 17);">Здійснивши замовлення на нашому сайті, Ви погоджуєтесь отримати смс-повідомлення про доставку купленого Вами товару в вказане Вами поштове відділення.</span></p>
																													<p style="text-align: center;"><strong><span style="color: rgb(17, 17, 17);">Дякуємо Вам за проявлений інтерес.</span><br></strong></p>
